import './App.css';
import { useAuth0 } from "@auth0/auth0-react";


const LoginButton = () => {
  const { loginWithRedirect } = useAuth0();

  return <button onClick={() => loginWithRedirect()}>Log In</button>;
};
function App() {
  return (
    <LoginButton></LoginButton>
  );
}

export default App;
